tables.table_schema:
CREATE TABLE traffic_data (
    timestamp TIMESTAMP,
    vehicle_id INT,
    speed FLOAT,
    location VARCHAR(50)
);

CREATE TABLE congestion_levels (
    timestamp TIMESTAMP,
    location VARCHAR(50),
    congestion_level INT
);

CREATE TABLE congestion_history (
    location VARCHAR(255),
    date TIMESTAMP,
    congestion_index INT
);

CREATE TABLE traffic_analysis (
    location VARCHAR(255),
    date TIMESTAMP,
    congestion_level VARCHAR(20),
    analysis_result VARCHAR(255)
);

CREATE TABLE traffic_data (
    id INT PRIMARY KEY,
    timestamp TIMESTAMP,
    vehicle_type VARCHAR(255),
    speed FLOAT
);

CREATE TABLE location_data (
    id INT PRIMARY KEY,
    location_id VARCHAR(255),
    latitude FLOAT,
    longitude FLOAT
);

CREATE TABLE congestion_data (
    id INT PRIMARY KEY,
    area_id VARCHAR(255),
    congestion_level INT
);

CREATE TABLE traffic_reports (
    id INT PRIMARY KEY,
    report_id VARCHAR(255),
    timestamp TIMESTAMP,
    congestion_level INT
);
